package JavaDataTypes;

public class allInOneDataTypes {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		boolean a = true;
		char b = 'A';
		byte c = 127;
		short d = 150;
		int e = 656565;
		long f = 65656565656565656l;
		float g = 3.14f;
		double h = 65.32323233d;
		
		System.out.println("Printing:"+a+"\n"+b+"\n"+c+"\n"+d+"\n"+e+"\n"+f+"\n"+g+"\n"+h);
	}

}
